import React, { Component } from "react";

class CardItem extends Component {
  render() {
    return (
      <div className="card text-center card-block d-flex">
        <br/>
        <span className="card-item-title">naomi olive</span>
        <img className="card-img-top"
             src="https://s1.bukalapak.com/img/1650748293/w-1000/sepatu_wakai_original__wakai_shoes_ori_size_40_ready_Good_Pr.jpg"
             alt="Card image cap"/>
        <div className="card-body">
          <h6 className="card-item-price">Rp. 500.000</h6>
          <button className="btn btn-primary btn-card glacial-indifference">add to cart</button>
        </div>
      </div>
    );
  }
}

export default CardItem;
